  return (
    <>
      <div className = {` ${themename} section `}>
        <a
          href="https://github.com/gautamverma095"
          rel="noreferrer"
          target="_blank"
        >
          <h3  className = {` ${themename} footer`}>Made By Gautam Verma</h3>
        </a>
      </div>
    </>
  );
};
